import './App.css';
import logo from './logo.png';
import Home from './Home';
import "bootstrap/dist/css/bootstrap.min.css";
import Results from './results';
import { useState } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function App() {
  const [resultsData, setResultsData] = useState(null);

  const renderResults = (data) => {
    setResultsData(data);
  };

  return (
    <Router>
      <div className="App">
        <div className='topBar'>
          <div id='logo'>
          <img src={logo} alt="logo" />
          </div>
          <div id="title-box">
            <div id="title-text">Bioanalytical Procedure Database System</div>
            <div id="sub-text">The Data Mine - Corporate Partners: Merck NLP</div>
          </div>
        </div>
        <Routes>
          <Route path="/" element={<Home renderResults={renderResults} />} />
          <Route path="/results" element={<Results resultsData={resultsData} />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
